import SignInForm from '../components/molecules/signinform'

export default () => (
    <div className="page">
        <Nav />
        <h1>ログイン</h1>
        <SignInForm />
        <style jsx>{`
            div {
                display: flex;
            }
        `}</style>
    </div>

)
